import React, { Component } from 'react'

export default class RefundDetails extends Component {
    render() {
        return (
            <div>
                <tr>
                    <td>
                        <a href={`/post/${posts._id}`} style={{textDecoration:'none'}}>
                        {posts.payerName}
                    </a>
                    </td>
                    <td>{posts.nicNo}</td>
                    <td>{posts.contactNo}</td>
                    <td>{posts.emailAddress}</td>
                    <td>{posts.address}</td>
                    <td>
                  
                </td>
                </tr>
            </div>
        )
    }
}
